import Vue from 'vue'
import VueRouter from 'vue-router';
import { component } from 'vue/types/umd';
Vue.use(VueRouter);

import modifyField from "../components/modifyField.vue"
const routes = [
    {
        path: "/",
        component: modifyField
    }

]

const router = new VueRouter({
    routes
})

export default router
